import React from "react";
import { Container, Col, Row } from "react-bootstrap";
import layerCake from "../assets/RyanHunter/layercakexjm-15.JPG";
import layerCake11 from "../assets/RyanHunter/layercakexjm-11.JPG";
import layerCake19 from "../assets/RyanHunter/layercakexjm-19.JPG";
import layerCake23 from "../assets/RyanHunter/layercakexjm-23.JPG";
export default function CollabDetail() {
  return (
    <>
      <Container>
        <Row xs={1} md={1} lg={1}>
          <Col className="p-5">
            <img
              src={layerCake}
              alt="LayerCake"
              style={{ width: "100%", height: "100%" }}
            />
          </Col>
        </Row>
        <Row xs={3} md={3} lg={3}>
          <Col></Col>
          <Col></Col>
          <Col></Col>
        </Row>
      </Container>
    </>
  );
}
